import React from 'react';
import Autocomplete from './'

class Home extends React.Component {
	render(){
		return(
			<div>
				<h2>Start typing and experience the autocomplete wizardry!</h2>
					<Autocomplete
					suggestions={[
						'Alligator',
						'Bask',
						'fuck',
						'Crocodilian',
						'Death Roll',
						'Eggs',
						'Jaws',
						'Reptile',
						'Solitary', 
						'Tail',
						'Wetlands'
					]}
					/>
			</div>
			)
	}
}

export default Home;
